class Node {
    int val;
    Node next;
    Node random;

    public Node ( int val ) {
        this.val = val;
        this.next = null;
        this.random = null;
    }
}


class LinkedList {

    Node head = null;

    public LinkedList insertAtEnd ( LinkedList l, int data ) {
        Node node = new Node(data);
        node.val = data;

        if (l.head == null) {
            l.head = node;
        } else {
            Node currNode = l.head;

            while (currNode.next != null) {
                currNode = currNode.next;
            }

            currNode.next = node;
            currNode.random = node;
        }

        return l;
    }

    public LinkedList remove ( LinkedList list, int data ) {
        if (list.head == null) {
            return null;
        }

        if (list.head.val == data) {
            list.head = list.head.next;
        } else {
            Node currNode = list.head;
            while (currNode.next != null) {
                if (currNode.next.val == data) {
                    Node node = currNode.next.next;
                    currNode.next = node;
                }
                currNode = currNode.next;
            }

        }
        return list;
    }

}



class MyCalendar {
    List< List< Integer > > myList = new ArrayList<>();

    public MyCalendar () {

    }

    public boolean book ( int start, int end ) {
        if (myList.size() == 0) {
            List< Integer > l = new ArrayList<>();
            l.add(start);
            l.add(end);
            myList.add(l);
            return true;
        } else {

            for (List< Integer > l : myList) {
                if ((start >= l.get(0) && start <= l.get(1)) || end >= l.get(0) && end <= l.get(1)) {
                    return false;
                }
                if (start < l.get(0) && end > l.get(1)) {
                    return false;
                }

            }

            List< Integer > l1 = new ArrayList<>();
            l1.add(start);
            l1.add(end);
            myList.add(l1);

            return true;
        }

    }
}

