class TreeNode {

    int val;
    TreeNode left;
    TreeNode right;

    TreeNode () {
    }

    TreeNode ( int val ) {
        this.val = val;
    }

    TreeNode ( int val, TreeNode left, TreeNode right ) {
        this.val = val;
        this.left = left;
        this.right = right;
    }
}


class BST {

    List< Integer > l = new ArrayList<>();

    public void inOrder ( TreeNode root ) {
        if (root == null) {
            return;
        }
        inOrder(root.left);
        l.add(root.val);
        inOrder(root.right);
    }

    public int depth ( TreeNode root ) {
        if (root == null) {
            return 0;
        }

        int left = depth(root.left);
        int right = depth(root.right);

        if (left > right) {
            return left + 1;
        } else {
            return right + 1;
        }
    }
}

